// src/pages/Home.js (or src/pages/ArtSphere.js)
import React from 'react';
import '../styles/Home.css';

function Home() {
    return (
        <div className="home-container">
            <h1>Welcome to ArtSphere</h1>
            <div className="images-container">
                <img src="../public/art1.jpg" alt="Image 1" className="image" />
                <img src="../public/art2.jpg" alt="Image 2" className="image" />
                <img src="../public/art3.jpg" alt="Image 3" className="image" />
                <img src="../public/art4.jpg" alt="Image 4" className="image" />
                <img src="../public/art5.jpg" alt="Image 5" className="image" />
                <img src="../public/art6.jpg" alt="Image 6" className="image" />
            </div>
        </div>
    );
}

export default Home;
